import './TierListContentStyles.css';
import WorkCard from './WorkCard';
import WorkCardData from './WorkCardData'


import React from 'react'


const TierListContentStyles = () => {
  return (
    <div className='work-container'>
        <h1 className='project-heading'>Tier Lists</h1>
        <div className='project-container'>
           {WorkCardData.map((val, ind) => {
            return(
                <WorkCard 
                    key={ind}
                    imgsrc={val.imgsrc}
                    title={val.title}
                    text={val.text}
                    view={val.view}
                />
            )
           })}
        </div>
    </div>
  )
}

export default TierListContentStyles
